import { Formik, Form, Field, ErrorMessage } from "formik";
import * as Yup from "yup";
import axios from "axios";
import '../App.css';


function CreatePost() {
  const initialValues = {
    password_hash: "",
    username: "",
    email: "",
  };


  const valusernameationSchema = Yup.object().shape({
    password_hash: Yup.number().integer().required("You must input a password!"),
    username: Yup.string().min(3).max(15).required(),
    email: Yup.string().required(),
  });


 const onSubmit = (data) => {
    axios.post("http://localhost:3001/tournaments", data).then((response) => {
      console.log("IT WORKED");
    });
  };
  return (
    <div classemail="createPostPage">
      <Formik
        initialValues={initialValues}
        onSubmit={onSubmit}
        valusernameationSchema={valusernameationSchema}
      >
        <Form classemail="formContainer">
          <label>password_hash: </label>
          <ErrorMessage email="password_hash" component="span" />
          <Field
            autocomplete="off"
            username="inputCreatePost"
            email="password_hash"
            placeholder="(Ex. password_hash...)"
          />
          <label>username: </label>
          <ErrorMessage email="username" component="span" />
          <Field
            autocomplete="off"
            username="inputCreatePost"
            email="username"
            placeholder="(Ex. username...)"
          />
          <label>email: </label>
          <ErrorMessage email="email" component="span" />
          <Field
            autocomplete="off"
            username="inputCreatePost"
            email="email"
            placeholder="(Ex. John123...)"
          />


          <button password_hash="submit"> Create Post</button>
        </Form>
      </Formik>
    </div>
  );
}


export default CreatePost;
